import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  IconButton,
} from "@mui/material";
import { useState, useEffect } from "react";
import LoanIconButton from "../../../../Common/LoanIconButton";
import CompanyModal from "../../../Common/CompanyModal";
import { RiSkipBackMiniFill } from "react-icons/ri";
import { BsPlus } from "react-icons/bs";
import { BiSkipNext, BiSkipPrevious } from "react-icons/bi";
import { IoRefresh } from "react-icons/io5";
import LoanTextField from "../../../../Common/LoanTextField";
import { ToastContainer, toast } from "react-toastify";
const AddLCFacility = ({
  submitted,
  handleBack,
  handleSkip,
  handleNext,
  saveLCFacility,
  MerchandiseFacilitys,
  handleInputChangeMerchandiseFacility,
  setLCFacilitys,
}) => {
  const [isMerchandiseFacilityModalOpen, setIsMerchandiseFacilityModalOpen] =
    useState(false);
  function handleMerchandiseFacilityOpenModal() {
    setIsMerchandiseFacilityModalOpen(true);
  }
  function handlMerchandiseFacilityCloseModal() {
    setIsMerchandiseFacilityModalOpen(false);
  }
  const [startDate, setStartDate] = useState(new Date());
  const [expiredDate, setExpiredDate] = useState(new Date());
  const [disbursementDate, setDisbursementDate] = useState(new Date());

  return (
    <>
      <div className="flex">
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipPrevious />}
          text="Back"
          onClick={handleSkip}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BsPlus />}
          text="Add"
          onClick={handleMerchandiseFacilityOpenModal}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipNext />}
          text="Skip"
          onClick={handleSkip}
        />
      </div>
      <CompanyModal
        isOpen={isMerchandiseFacilityModalOpen}
        onClose={handlMerchandiseFacilityCloseModal}
        title="Merchandise Facility "
      >
        <div>
          <ToastContainer />
          <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
            <LoanTextField
              id="MerchandiseAC"
              label="MerchandiseAC"
              value={MerchandiseFacilitys.MerchandiseAC}
              onChange={handleInputChangeMerchandiseFacility}
              name="MerchandiseAC"
            />
            <LoanTextField
              id="ApprovedFacilityLimit"
              label="ApprovedFacilityLimit"
              value={MerchandiseFacilitys.ApprovedFacilityLimit}
              onChange={handleInputChangeMerchandiseFacility}
              name="ApprovedFacilityLimit"
            />
            <p>
              Start Date
              <input
                id="StartDate"
                name="StartDate"
                label="StartDate"
                placeholder="StartDate"
                type="date"
                value={
                  startDate.getFullYear().toString() +
                  "-" +
                  (startDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  startDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setStartDate(new Date(e.target.value));
                  MerchandiseFacilitys.StartDate = startDate;
                }}
              />{" "}
            </p>
            <p>
              Expired Date
              <input
                id="ExpiredDate"
                name="ExpiredDate"
                label="ExpiredDate"
                placeholder="ExpiredDate"
                type="date"
                value={
                  expiredDate.getFullYear().toString() +
                  "-" +
                  (expiredDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  expiredDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setExpiredDate(new Date(e.target.value));
                  MerchandiseFacilitys.ExpiredDate = expiredDate;
                }}
              />{" "}
            </p>
            <p>
              Disbursement Date
              <input
                id="DisbursementDate"
                name="DisbursementDate"
                label="DisbursementDate"
                placeholder="DisbursementDate"
                type="date"
                value={
                  disbursementDate.getFullYear().toString() +
                  "-" +
                  (disbursementDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  disbursementDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setDisbursementDate(new Date(e.target.value));
                  MerchandiseFacilitys.DisbursementDate = disbursementDate;
                }}
              />{" "}
            </p>
            <LoanTextField
              id="DisbursementAmount"
              label="DisbursementAmount"
              value={MerchandiseFacilitys.DisbursementAmount}
              onChange={handleInputChangeMerchandiseFacility}
              name="DisbursementAmount"
            />
            <LoanTextField
              id="DisbursementSettlementDay"
              label="DisbursementSettlementDay"
              value={MerchandiseFacilitys.DisbursementSettlementDay}
              onChange={handleInputChangeMerchandiseFacility}
              name="DisbursementSettlementDay"
            />
            <LoanTextField
              id="ActualSettlementDays"
              label="ActualSettlementDays"
              value={MerchandiseFacilitys.ActualSettlementDays}
              onChange={handleInputChangeMerchandiseFacility}
              name="ActualSettlementDays"
            />
            <LoanTextField
              id="TotalDisbursementInFacilityPeriod"
              label="TotalDisbursementInFacilityPeriod"
              value={MerchandiseFacilitys.TotalDisbursementInFacilityPeriod}
              onChange={handleInputChangeMerchandiseFacility}
              name="TotalDisbursementInFacilityPeriod"
            />
          </div>
          <div className="flex justify-center p-2 pt-5">
            <button
              className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              onClick={() => {
                saveLCFacility();
              }}
            >
              Save
            </button>
          </div>
        </div>
      </CompanyModal>
    </>
  );
};
export default AddLCFacility;
